import React from 'react';
import { Header } from './componentes/Header';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './componentes/login';

function App() {
  return (
    <Router>
      <Route path='/' element={<Header />} ></Route>
    </Router>
  );
}

export default App;
